  `category_id` bigint(11) NULL DEFAULT NULL COMMENT ' 商品类目ID，使用pdd.goods.cats.get接口获取',
  `category_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品类目名',
  `opt_id` int(11) NULL DEFAULT NULL COMMENT ' 商品标签ID，使用pdd.goods.opts.get接口获取',
  `opt_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品标签名',
