  `sales_tip` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT ' 已售卖件数',
  `activity_type` int(255) NULL DEFAULT NULL COMMENT ' 活动类型，0-无活动;1-秒杀;3-限量折扣;12-限时折扣;13-大促活动;14-名品折扣;15-品牌清仓;16-食品超市;17-一元幸运团;18-爱逛街;19-时尚穿搭;20-男人帮;21-9块9;22-竞价活动;23-榜单活动;24-幸运半价购;25-定金预售;26-幸运人气购;27-特色主题活动;28-断码清仓;29-一元话费;30-电器城;31-每日好店;32-品牌卡;101-大促搜索池;102-大促品类分会场;',
  `service_tags` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT ' 服务标签: 4-送货入户并安装,5-送货入户,6-电子发票,9-坏果包赔,11-闪电退款,12-24小时发货,13-48小时发货,17-顺丰包邮,18-只换不修,19-全国联保,20-分期付款,24-极速退款,25-品质保障,26-缺重包退,27-当日发货,28-可定制化,29-预约配送,1000001-正品发票,1000002-送货入户并安装',
  `clt_cpn_batch_sn` bigint(255) NULL DEFAULT NULL COMMENT ' 店铺收藏券id',
  `clt_cpn_start_time` bigint(255) NULL DEFAULT NULL COMMENT ' 店铺收藏券起始时间',
  `clt_cpn_end_time` bigint(20) NULL DEFAULT NULL COMMENT ' 店铺收藏券截止时间',
  `clt_cpn_quantity` bigint(255) NULL DEFAULT NULL COMMENT '店铺收藏券总量',
  `clt_cpn_remain_quantity` bigint(255) NULL DEFAULT NULL COMMENT '店铺收藏券剩余量',
  `clt_cpn_discount` bigint(255) NULL DEFAULT NULL COMMENT ' 店铺收藏券面额，单位为分',
  `clt_cpn_min_amt` bigint(255) NULL DEFAULT NULL COMMENT ' 店铺收藏券使用门槛价格，单位为分',
  `desc_txt` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '描述分',
  `serv_txt` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '服务分',
  `lgst_txt` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流分',
  `plan_type` int(255) NULL DEFAULT NULL COMMENT ' 推广计划类型 3:定向 4:招商',
  `zs_duo_id` bigint(11) NULL DEFAULT NULL COMMENT ' 招商团长id',
  `goods_status` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '商品状态',
  `be_in_charge_of` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '负责人',
  `is_contact` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 5266 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

